template <typename T>
void shuffle_array(T arr[], int size) {
    for (int i = size - 1; i > 0; --i) {
        std::uniform_int_distribution<> dis(0, i);
        int j = dis(mt);
        if (i != j) {
            std::swap(arr[i], arr[j]);
        }
    }
}

