struct Point {
  int i, j;
};

bool operator==(const Point& lhs, const Point& rhs) {
  return (lhs.i == rhs.i and lhs.j == rhs.j);
}

bool operator!=(const Point& lhs, const Point& rhs) {
  return (lhs.i != rhs.i or lhs.j != rhs.j);
}

bool operator>(const Point& lhs, const Point& rhs) {
  return (lhs.i == rhs.i ? lhs.j > rhs.j : lhs.i > rhs.i);
}

bool operator<(const Point& lhs, const Point& rhs) {
  return (lhs.i == rhs.i ? lhs.j < rhs.j : lhs.i < rhs.i);
}

