  std::vector<pair<int, pii>> find_uncertain_by_simulation() {
    int num_sim = 3;
    std::vector<std::vector<int>> path_cnt(N, std::vector<int>(N, 0));
    std::vector<pair<int, pii>> cnt_list;
    for(int si = 0; si < num_sim; si++) {
      this->simulate_path(path_cnt);
    }
    shuffle_array(dn, N);
    int i, j;
    for(int s = 0; s < N; s++) {
      for(int t = 0; t < N; t++) {
        i = dn[s];
        j = dn[t];
        if(mst[i][j] > 0 and not nodes[i][j].done) cnt_list.push_back({path_cnt[i][j], pii{i,j}});
      }
    }
    std::sort(cnt_list.begin(), cnt_list.end(),
      [](const pair<int,pii>& lhs, const pair<int,pii>& rhs) {
        return lhs.first < rhs.first;
      }
    );
    return cnt_list;
  }

  void refine_mst() {
    typedef pair<double, pair<Point, Point>> Edge;
    std::cerr << "START REFINING (FROM refine mst)" << std::endl;
    std::vector<std::vector<Point>> pre;
    Dist dist;
    for(auto [p1, p2]: this->edges) {
      // bfs for path finding
      pre.clear();
      pre.resize(N, std::vector<Point>(N, Point{-1, -1}));
      dist.clear();
      dist.resize(N, std::vector<double>(N, 1e18));
      pre[p1.i][p1.j] = p1;
      dist[p1.i][p1.j] = 0.0;
      std::priority_queue<Edge, std::vector<Edge>, std::greater<Edge>> pq;
      pq.push({0.0, {Point{-1, -1}, p1}});
      bool found = false;
      while(!pq.empty() and not found) {
        Point cur = pq.top().second.second;
        double cost = pq.top().first;
        pq.pop();
        if(cost > dist[cur.i][cur.j] + EPS) continue;
        shuffle_array(d4, 4);
        for(int k = 0; k < 4; k++) {
          int ni = cur.i + di[d4[k]];
          int nj = cur.j + dj[d4[k]];
          if(is_out(ni, nj, N)) continue;
          if(pre[ni][nj] != Point{-1, -1} or this->mst[ni][nj] == 0) continue;
          int w = this->nodes[ni][nj].stiff_exp;
          if(dist[ni][nj] > dist[cur.i][cur.j] + w + EPS) {
            dist[ni][nj] = dist[cur.i][cur.j] + w;
            pre[ni][nj] = cur;
            if(Point{ni, nj} == p2) {
              found = true;
              break;
            }
            pq.push({dist[ni][nj], {cur, Point{ni, nj}}});
          }
        }
      }


      Point cur = pre[p2.i][p2.j];
      while(true) {
        std::cerr << cur.i << " " << cur.j << std::endl;
        if(pre[cur.i][cur.j] == cur) break;
        assert(this->mst[cur.i][cur.j] > 0);
        this->mst[cur.i][cur.j]--;
        cur = pre[cur.i][cur.j];
      }
      std::cerr << "mst tempolary deleted" << std::endl;
      this->update_mst_on_dijkstra_path(p1, p2, this->mst, true);
    }
  }

