bool arg_parse(int argc, char* argv[]) {
  for(int i = 1; i < argc; i++) {
    if(std::strcmp(argv[i], "--seed")==0) {
      if(i + 1  >= argc) {
        std::cerr << "Invalid argument" << std::endl;
        return false;
      } else {
        int seed = std::stoi(argv[i+1]);
        mt = std::mt19937(seed);
      }
      i++;
    } else if(std::strcmp(argv[i], "--start")==0) {
      if(i + 1  >= argc) {
        std::cerr << "Invalid argument" << std::endl;
        return false;
      } else {
        for(int j = 0; j < 8; j++) {
          param::starts[j] = std::stoi(argv[i+1]);
        }
      }
      i++;
    } else if(std::strcmp(argv[i], "--coef") == 0) {
      if(i + 1  >= argc) {
        std::cerr << "Invalid argument" << std::endl;
        return false;
      } else {
        for(int j = 0; j < 8; j++) {
          param::coefs[j] = std::stod(argv[i+1]);
        }
      }
      i++;
    } else if(std::strcmp(argv[i], "--stiff") == 0){
      if(i + 1  >= argc) {
        std::cerr << "Invalid argument" << std::endl;
        return false;
      } else {
        for(int j = 0; j < 8; j++) {
          param::INIT_STIF_EXP = std::stoi(argv[i+1]);
        }
      }
      i++;
    } else if(std::strcmp(argv[i], "--C") == 0) {
      if(i + 1  >= argc) {
        std::cerr << "Invalid argument" << std::endl;
        return false;
      } else {
        param::pre_defined_C = std::stoi(argv[i+1]);
      }
      i++;
    } else if(std::strcmp(argv[i], "--TL") == 0) {
      if(i + 1  >= argc) {
        std::cerr << "Invalid argument" << std::endl;
        return false;
      } else {
        param::TL = std::stod(argv[i+1]);
        param::TL_95 = 0.95 * param::TL;
      }
      i++;

    }
  }
  return true;
}

int main(int argc, char* argv[]) {
  start_time = clock();
  Solver solver;

  #ifdef _OPTUNA
  if(!arg_parse(argc, argv)) return -1;
  #endif

  solver.init();
  solver.solve2();
  solver.summary();
  return 0;
}